import React from "react";
import HornedBeast from "./HornedBeast";
import App from './App'

class Main extends React.Component {
    render () {
        return (
            <main>
                <HornedBeast title="Uniwhal" imageurl="http://3.bp.blogspot.com/_DBYF1AdFaHw/TE-f0cDQ24I/AAAAAAAACZg/l-FdTZ6M7z8/s1600/Unicorn_and_Narwhal_by_dinglehopper.jpg" description="A unicorn and a narwhal nuzzling their horns"/>
                <HornedBeast title="Rhino Family" image_url="https://images.unsplash.com/photo-1512636618879-bbe79107e9e3?ixlib=rb-0.3.5&ixid=eyJhcHBfaWQiOjEyMDd9&s=bd9460ee6d1ddbb6b1ca7be86dfc4590&auto=format&fit=crop&w=1825&q=80" description="Parent rhino with two babies"/>
                <HornedBeast title="Unicorn Head" image_url="https://www.dhresource.com/0x0s/f2-albu-g5-M00-1A-11-rBVaI1hsIIiALxKzAAIHjSU3VkE490.jpg/wholesale-halloween-costume-prop-unicorn.jpg"
                description="Someone wearing a very silly unicorn head mask"/>
            </main>
            )
    }
}

export default Main;
